//         <>
//             <footer>
//                 <Container>
//                     <Row>
//                         <Col md={12}>
//                             <span classNameName="text-center">
//                                 Copyright &copy; Techinfo YT
//                             </span>
//                         </Col>
//                     </Row>
//                 </Container>
//             </footer>
//         </>
//     )
// }



import React from 'react';
import { Container,Row, Col } from 'react-bootstrap' 


export const footer = () => {
  return (
    <>
                 {/* <footer>
                     <Container>
                         <Row>
                             <Col classNameName="text-center">
                                 <span > Copyright &copy;</span>
                             </Col>
                         </Row>
                     </Container>
                 </footer> */}
                 <footer className="text-center text-white" style="background-color: #f1f1f1;">
  {/* <!-- Grid container --> */}
  <div className="container pt-4">
    {/* <!-- Section: Social media --> */}
    <section className="mb-4">
      {/* <!-- Facebook --> */}
      <a
        className="btn btn-link btn-floating btn-lg text-dark m-1"
        href="#!"
        role="button"
        data-mdb-ripple-color="dark"
        ><i className="fab fa-facebook-f"></i
      ></a>

      {/* <!-- Twitter --> */}
      <a
        className="btn btn-link btn-floating btn-lg text-dark m-1"
        href="#!"
        role="button"
        data-mdb-ripple-color="dark"
        ><i className="fab fa-twitter"></i
      ></a>

      {/* <!-- Google --> */}
      <a
        className="btn btn-link btn-floating btn-lg text-dark m-1"
        href="#!"
        role="button"
        data-mdb-ripple-color="dark"
        ><i className="fab fa-google"></i
      ></a>

      {/* <!-- Instagram --> */}
      <a
        className="btn btn-link btn-floating btn-lg text-dark m-1"
        href="#!"
        role="button"
        data-mdb-ripple-color="dark"
        ><i className="fab fa-instagram"></i
      ></a>

      {/* <!-- Linkedin --> */}
      <a
        className="btn btn-link btn-floating btn-lg text-dark m-1"
        href="#!"
        role="button"
        data-mdb-ripple-color="dark"
        ><i className="fab fa-linkedin"></i
      ></a>
      {/* <!-- Github --> */}
      <a
        className="btn btn-link btn-floating btn-lg text-dark m-1"
        href="#!"
        role="button"
        data-mdb-ripple-color="dark"
        ><i className="fab fa-github"></i
      ></a>
    </section>
    {/* <!-- Section: Social media --> */}
  </div>
  {/* <!-- Grid container --> */}

  {/* <!-- Copyright --> */}
  <div className="text-center text-dark p-3" style="background-color: rgba(0, 0, 0, 0.2);">
    Â© 2020 Copyright:
    <a className="text-dark" href="https://mdbootstrap.com/">MDBootstrap.com</a>
  </div>
  {/* <!-- Copyright --> */}
</footer>
             </>
  
    )
};

export default footer
